import './styles.css';
import BtnHome from './assets/btnhome.svg';
import BtnClientes from './assets/btnclientes.svg';
import BtnCobrancas from './assets/btncobrancas.svg';


const SideMenu = () => {
  return(
    <div className>
      <div className="sign-nav-menu">      
        <img
          className="btn-home-nav"
          src={BtnHome}
          alt="Botao Home"       
          />      
        <img
          className="btn-clientes-nav"
          src={BtnClientes}
          alt="Botao Home"       
          />      
        <img
          className="btncobrancas-nav"
          src={BtnCobrancas}
          alt="Botao Home"       
          />      
      </div>
    </div>
  ); 
};

export default SideMenu;
